import React from 'react'
import { navigations } from '../../utils/utils'
import { Link } from 'react-router-dom'

const Navbar=()=>{
    return(
        <nav>
            {
               navigations.map((link)=>{
                   return <li key={link.id}>
                       <Link to={link.url}>{text}</Link>
                   </li>
               })
            }
        </nav>
    )
}

export default Navbar
